import { useEffect } from 'react';

/**
 * トップ画面
 * @returns
 */
function Top() {
	useEffect(() => {
		document.title = 'ShareJob';
	}, []);
	return (
		<div>
			<h1>shareJobへようこそ!</h1>
			本サイトでは主に以下のことができます
			<ul>
				<li>項目1</li>
				<li>項目2</li>
				<li>項目3</li>
			</ul>
		</div>
	);
}

export default Top;
